import React from "react";
import { Headline, Card, Avatar } from "react-native-paper";
import styled from "styled-components/native";
import { FlatList } from "react-native-gesture-handler";

const LeftContent = props => <Avatar.Icon style={{backgroundColor: "rgb(25, 118, 210)"}}  {...props} icon="chat" />

export const Layout = ({ navigation, token, data }) => (
    <Container>
        { token ? 
            <FlatList
                data={data.trips}
                renderItem={ ({ item }) =>
                <Card style={{marginVertical: 10}}>
                    <Card.Title title={item.name} left={LeftContent}/>
                </Card>
                }
                keyExtractor={item => item.id}
            />
            :
            <Headline style={{marginVertical: 10}}> You need login to see your trips </Headline>
        }
    </Container>
)

const Container = styled.ScrollView`
  flex: 1;
  padding: 0px 20px;
`;
